import React, { useState } from 'react';
import { Card, Typography, Box, Button, Grid, Avatar } from '@mui/material';
import ChampionImage from './ChampionImage';
import ItemImages from './ItemImages';
import SpellImages from './SpellImages';
import RuneImages from './RuneImages';

function Match({ match }) {
  const [isExpanded, setIsExpanded] = useState(false);

  const toggleExpand = () => setIsExpanded(!isExpanded);

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    opScore,
    damage,
    wards,
    cs,
    gameDuration,
    summonerSpells = [],
    runes = [],
    participants = [],
    version = "14.21.1",
    gameMode = "Unknown",
    teamKills,
    teamGold,
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const matchBgColor = win ? '#0d47a1' : '#b71c1c';

  return (
    <Card
      variant="outlined"
      sx={{
        mb: 1,
        backgroundColor: matchBgColor,
        color: '#f0f0f0',
        boxShadow: 4,
        borderRadius: 2,
        p: 1,
      }}
    >
      {/* Basic match summary */}
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <Box display="flex" alignItems="center">
          <ChampionImage champion={champion} version={version} />
          <Box ml={2}>
            <Typography variant="h6">{matchOutcome}</Typography>
            <Typography variant="body2">{kills}/{deaths}/{assists} K/D/A</Typography>
          </Box>
        </Box>
        <Button onClick={toggleExpand} variant="text" color="primary">
          {isExpanded ? "Hide Details" : "Show Details"}
        </Button>
      </Box>

      {/* Expanded match details */}
      {isExpanded && (
        <Box mt={2} sx={{ backgroundColor: '#1f2937', p: 2, borderRadius: '8px' }}>
          <Grid container spacing={2}>
            {/* Team 1 Details */}
            <Grid item xs={6}>
              <Typography variant="subtitle1">Blue Team</Typography>
              <Typography>OP Score: {opScore}</Typography>
              <Typography>KDA: {kills}/{deaths}/{assists}</Typography>
              <Typography>Damage: {damage}</Typography>
              <Typography>Wards: {wards}</Typography>
              <Typography>CS: {cs}</Typography>
              <Typography>Total Kills: {teamKills}</Typography>
              <Typography>Total Gold: {teamGold}</Typography>
              <Box display="flex" gap={1} mt={1}>
                <SpellImages spells={summonerSpells} version={version} />
                <RuneImages runes={runes} />
                <ItemImages items={items} version={version} />
              </Box>
            </Grid>
            {/* Team 2 Details */}
            <Grid item xs={6}>
              <Typography variant="subtitle1">Red Team</Typography>
              <Box display="flex" flexDirection="column">
                {participants.slice(5).map((p, index) => (
                  <Box key={index} display="flex" alignItems="center" mb={0.5}>
                    <Avatar
                      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${p.championName}.png`}
                      alt={p.championName}
                      sx={{ width: 20, height: 20, mr: 0.5 }}
                    />
                    <Typography variant="caption" color="#f0f0f0">
                      {p.summonerName}
                    </Typography>
                  </Box>
                ))}
              </Box>
            </Grid>
          </Grid>
        </Box>
      )}
    </Card>
  );
}

export default Match;
